import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import Slider from 'react-slick';
import "slick-carousel/slick/slick-theme.css";
import "slick-carousel/slick/slick.css";
import "./Home.css";

const Home = () => {
  const settings = {
    dots: true,
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 2,
    speed: 500,
    autoplay:true,
    autoplaySpeed: 3000,
    arrows: true,
    
  };
  return (
    <div  >
      <div style={{background:'yellow'}}>
        hello
      </div>
      <div style={{background:'#eee', width:'100%', height:'100%'}}>
        <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
        </Slider>
      </div>
    </div>
  );
};

export default Home;
